import React from 'react';
import RegisterForm from './components/RegisterForm';
import UserList from './components/UserList';

function App() {
  return (
    <div className="container mt-5">
      <h1 className="text-center text-primary mb-4">SkillBridge</h1>
      <RegisterForm />
      <UserList />
    </div>
  );
}

export default App;
